#include <vector>
#include <stack>

using namespace std;


void heapify(std::vector<int>& arr, int n, int i, long long int& comparacoes, long long & trocas) {
    int maior = i; // Inicializa o maior como raiz
    int esquerda = 2 * i + 1;
    int direita = 2 * i + 2;

    // Se o filho da esquerda é maior que a raiz
    comparacoes++;
    if (esquerda < n && arr[esquerda] > arr[maior])
        maior = esquerda;

    // Se o filho da direita é maior que o maior até agora
    comparacoes++;
    if (direita < n && arr[direita] > arr[maior])
        maior = direita;

    // Se o maior não é a raiz
    if (maior != i) {
        std::swap(arr[i], arr[maior]);
        trocas++;

        // Heapify recursivamente o sub-heap afetado
        heapify(arr, n, maior, comparacoes, trocas);
    }
}

void heapSort(std::vector<int>& arr, long long int& comparacoes, long long int& trocas) {
    int n = arr.size();
    comparacoes = 0;
    trocas = 0;

    // Constrói o heap (rearranja o array)
    for (int i = n / 2 - 1; i >= 0; i--)
        heapify(arr, n, i, comparacoes, trocas);

    // Extrai um por um os elementos do heap
    for (int i = n - 1; i > 0; i--) {
        // Move a raiz atual para o final
        std::swap(arr[0], arr[i]);
        trocas++;

        // Chama a função heapify no heap reduzido
        heapify(arr, i, 0, comparacoes, trocas);
    }
}


void bubbleSort(vector<int>& arr, long long int &comparacoes, long long int &trocas) {
    int n = arr.size();
    for (int i = 0; i < n - 1; i++) {
        for (int j = 0; j < n - i - 1; j++) {
            comparacoes++;
            if (arr[j] > arr[j + 1]) {
                std::swap(arr[j], arr[j + 1]);
                trocas++;
            }
        }
    }
}

void improvedBubbleSort(vector<int>& arr, long long int &comparacoes, long long int &trocas) {
    int n = arr.size();
    bool swapped = true;
    for (int i = 0; i < n - 1; i++) {
        swapped = false;
        for (int j = 0; j < n - i - 1; j++) {
            comparacoes++;
            if (arr[j] > arr[j + 1]) {
                std::swap(arr[j], arr[j + 1]);
                trocas++;
                swapped = true;
            }
        }
        if (swapped == false)
        {
            break;
        }
    }
}

void insertionSort(vector<int>& arr, long long int &comparacoes, long long int &trocas) {
    int n = arr.size();
    int key, j;
    for (int i = 1; i < n; i++) {
        key = arr[i];
        j = i - 1;
        while (j >= 0 && arr[j] > key) {
            comparacoes++;
            arr[j + 1] = arr[j];
            trocas++;
            j = j - 1;
        }
        arr[j + 1] = key;
        if (j >= 0) comparacoes++;
    }
}

void selectionSort(vector<int>& arr, long long int &comparacoes, long long int &trocas) {
    int n = arr.size();
    int min_idx;
    for (int i = 0; i < n - 1; i++) {
        min_idx = i;
        for (int j = i + 1; j < n; j++) {
            comparacoes++;
            if (arr[j] < arr[min_idx])
                min_idx = j;
        }
        std::swap(arr[min_idx], arr[i]);
        trocas++;
    }
}

void merge(vector<int>& arr, int l, int m, int r, long long int& comparacoes, long long int& trocas) {
    int n1 = m - l + 1;
    int n2 = r - m;

    std::vector<int> L(n1), R(n2);

    for (int i = 0; i < n1; i++)
        L[i] = arr[l + i];
    for (int j = 0; j < n2; j++)
        R[j] = arr[m + 1 + j];

    int i = 0, j = 0, k = l;
    while (i < n1 && j < n2) {
        comparacoes++;
        if (L[i] <= R[j]) {
            arr[k] = L[i];
            i++;
        }
        else {
            arr[k] = R[j];
            j++;
        }
        k++;
        trocas++;
    }

    while (i < n1) {
        arr[k] = L[i];
        i++;
        k++;
        trocas++;
    }

    while (j < n2) {
        arr[k] = R[j];
        j++;
        k++;
        trocas++;
    }
}

void mergeSort(vector<int>& arr, int l, int r, long long int &comparacoes, long long int &trocas) {
    if (l < r) {
        int m = l + (r - l) / 2;
        mergeSort(arr, l, m, comparacoes, trocas);
        mergeSort(arr, m + 1, r, comparacoes, trocas);
        merge(arr, l, m, r, comparacoes, trocas);
    }
}

void swaper(int& a, int& b, long long int& trocas) {
    int temp = a;
    a = b;
    b = temp;
    trocas++;
}


int partition(std::vector<int>& arr, int low, int high, long long int& comparacoes, long long int& trocas) {
    int pivot = arr[high];
    int i = (low - 1);

    for (int j = low; j <= high - 1; j++) {
        comparacoes++;
        if (arr[j] < pivot) {
            i++;
            swaper(arr[i], arr[j], trocas);
            trocas++;
        }
    }
    swaper(arr[i + 1], arr[high], trocas);
    trocas++;
    return (i + 1);
}


void quickSort(std::vector<int>& arr, int low, int high, long long int& comparacoes, long long int& trocas) {
    std::stack<std::pair<int, int>> stack;
    comparacoes = 0;
    trocas = 0;

    stack.push(std::make_pair(low, high));

    while (!stack.empty()) {
        low = stack.top().first;
        high = stack.top().second;
        stack.pop();

        int pivot = partition(arr, low, high, comparacoes, trocas);

        if (pivot - 1 > low) {
            stack.push(std::make_pair(low, pivot - 1));
        }

        if (pivot + 1 < high) {
            stack.push(std::make_pair(pivot + 1, high));
        }
    }
}

void Array_dec(vector<int>& arr) {
    int size = arr.size();
    for (int i = 0; i < size; i++) {
        arr[i] = size - i;
    }
}

